import DashboardSwitcher from './DashboardSwitcher'

class Dashboard extends Component {
    render() {
        return (
            <div>
                <Header />
                <div className="container-fluid">
                    <div className="row">
                        <Sidebar />
                        <DashboardSwitcher />
                    </div>
                </div>
            </div>
        )
    }
}

export default Dashboard;
